import React, { useState, useEffect } from "react";
import axios from "axios"; // Importer Axios
import "../styles/AdminEvent.css"; // Ensure this file is correctly linked
import eventIcon from "../assets/events.png"; // Icon for event section
import organizers from "../assets/organizers.png"; // Icon for organizers section
import logoutIcon from "../assets/logout.png"; // Logout icon
import profilePic from "../assets/user.png"; // Profile picture
import eventImage from "../assets/event.png"; // Illustration inside event card
import logoIcon from "../assets/logo.png"; // Illustration inside event card

const PARdashboard = () => {
    const [events, setEvents] = useState([]); // Gérer l'état des événements

    useEffect(() => {
        // Fonction pour récupérer les événements via Axios
        const fetchEvents = async () => {
            try {
                const response = await axios.get("https://ton-api.com/events"); // Remplace avec ton URL d'API
                setEvents(response.data); // Stocker les événements dans l'état
            } catch (error) {
                console.error("There was an error fetching the events:", error);
            }
        };

        fetchEvents(); // Appeler la fonction pour récupérer les événements à l'initialisation
    }, []); // Le tableau vide [] indique que l'effet ne sera exécuté qu'une fois au montage du composant

    return (
        <div className="admin-container">
            {/* Sidebar */}
            <aside className="sidebar">
                <div className="logo-container">
                    <img src={logoIcon} alt="logo" className="logo-icon" />
                    <span className="logo-text">MYCERTS</span>
                </div>
                <nav>
                    <ul>
                        <li className="active">
                            <img src={eventIcon} alt="Events" />
                            <span>My Events</span>
                        </li>
                        <li>
                            <img src={organizers} alt="organizers" />
                            <span>Participants</span>
                        </li>
                    </ul>
                </nav>
                <button className="logout-btn">
                    <img src={logoutIcon} alt="Log Out" />
                    <span>Log Out</span>
                </button>
            </aside>

            {/* Main Content */}
            <main className="content">
                {/* Header */}
                <div className="header">
                    <h2>📅 <span>My Events</span></h2>
                    <div className="profile">
                        <span>Org. Amine</span>
                        <img src={profilePic} alt="Admin Profile" />
                    </div>
                </div>

                {/* Events List */}
                <div className="events-container">
                    {events.length === 0 ? (
                        <p>Loading events...</p> // Afficher un message de chargement si aucun événement n'est encore chargé
                    ) : (
                        events.map((event, index) => (
                            <div className="event-card" key={index}>
                                <img src={event.image || eventImage} alt={event.title} className="event-img" />
                                <div className="event-info">
                                    <h4>{event.title}</h4>
                                    <p className="event-date">{event.date}</p>
                                    <p className="event-description">{event.description}</p>
                                </div>
                            </div>
                        ))
                    )}
                </div>
            </main>

            {/* Calendar */}
            <div className="calendar">
                <h2>CALENDAR 2025</h2>
                <div className="months">
                    {["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"]
                        .map((month, index) => (
                            <span key={index} className={month === "March" ? "highlight" : ""}>
                                {month.toLowerCase()}
                            </span>
                        ))}
                </div>
            </div>
        </div>
    );
};

export default PARdashboard;
